import React, { Component } from 'react';
import { ToDoComponent } from './components/TodoComponent';

const style = {
  container: {
    display: 'flex',
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center'
  }
} 

class App extends Component {
  render() {
    return (
      <div className="App" style={style.container}>
        <ToDoComponent />
      </div>
    );
  }
}

export default App;
